import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';

// pages & components
import Navbar from './components/Navbar';
import Home from './pages/Home';
import Signup from './pages/Signup';

function App() {
  return (
    <div className="App">
      <Router>
      <Navbar/>
        <div className="pages">
          <Routes>
            <Route
              path="/"
              element={<Home />}
            ></Route>
            <Route
              path="/"
              element={<Login />}
            ></Route>
            <Route
              path="/"
              element={<Signup />}
            ></Route>
          </Routes>
        </div>
      </Router>

    </div>
  );
}

export default App;
